import React ,{useState} from 'react'
import './App.css';

import MovieCards from './MovieCards';
import {v4 as uuidv4} from 'uuidv4';
import MovieList from './MovieList';
import Filter from './Filter';

function App() {

  return (
    <div className="App">
      <header className="App-header">
      <MovieCards /> 
      <MovieList/>
      <Filter /> 
      </header>
    </div>
  );
}

export default App;
